import Home from './pages/Home'
import './App.css';
import Cutest from './pages/Cutest';
import Gallery from './pages/Gallery'
import { Route, Switch } from 'react-router-dom';


function App() {
  return (

    <div className="app">
    <Switch>
      <Route path="/">
        <Home /> 
      </Route>

      <Route path="/cutest">
        <Cutest /> 
      </Route>

      <Route path="gallery">
        <Gallery />
      </Route>
    </Switch> 
    </div>
  );
}

export default App;
